    def is_divisible_by_25(num: int) -> bool:
        return num % 25 == 0

    def swap_adjacent_digits(num: int) -> int:
        digits = [int(d) for d in str(num)]
        for i in range(len(digits) - 1):
            if digits[i] == 0 and digits[i+1] > 0:
                digits[i], digits[i+1] = digits[i+1], digits[i]
        return int(''.join(str(d) for d in digits))

    def min_moves_to_divisible_by_25(num: int) -> int:
        if is_divisible_by_25(num):
            return 0
        visited = set()
        queue = [(num, 0)]
        while queue:
            current_num, moves = queue.pop(0)
            if current_num in visited:
                continue
            visited.add(current_num)
            if is_divisible_by_25(current_num):
                return moves
            for i in range(len(str(current_num)) - 1):
                new_num = swap_adjacent_digits(current_num)
                queue.append((new_num, moves + 1))
        return -1

    return str(min_moves_to_divisible_by_25(n))

