            a[i][j] = 1 - a[i][j]
        return a

    def invert_matrix(a, r, c):
        if any(r_i == '1' for r_i in r):
            for i in range(n):
                if r[i] == '1':
                    a = invert_row(a, i)
        if any(c_j == '1' for c_j in c):
