        def determinant(a):
            n = len(a)
            if n == 2:
                return a[0][0] * a[1][1] - a[0][1] * a[1][0]
            else:
                return sum(a[0][j] * determinant(minor(a, 0, j)) for j in range(n))

        def minor(a, i, j):
            return [row[:j] + row[j+1:] for row in (a[:i] + a[i+1:])]

        return determinant(a) != 0

