        edges[vertex1][vertex2] = cost
        edges[vertex2][vertex1] = cost

    def dfs(edges, start, visited, costs):
        visited[start] = True
        for neighbor, cost in edges[start].items():
            if not visited[neighbor]:
                costs[0] += cost
                dfs(edges, neighbor, visited, costs)

    def min_cost(n, m, a, special_offers):
        edges = {}
        costs = [0]
        visited = [False] * n

        for x, y, w in special_offers:
            add_edge(edges, x, y, w)

        for i in range(1, n):
            add_edge(edges, i, 0, a[i])

        dfs(edges, 0, visited, costs)

        return costs[0]

