    def find_connected_components(n: int, edges: list) -> list:
        parent = [i for i in range(n)]

        def find(u: int) -> int:
            if parent[u] != u:
                parent[u] = find(parent[u])
            return parent[u]

        def union(u: int, v: int):
            root_u = find(u)
            root_v = find(v)
            if root_u != root_v:
                parent[root_u] = root_v

        for v, u in edges:
            union(v - 1, u - 1)

        result = []
        for i in range(n):
            if find(i) not in result:
                result.append(find(i))
        return result

    def is_cycle(component: list) -> bool:
        return len(component) > 2 and all(component[i] + 1 == component[(i + 1) % len(component)] for i in range(len(component)))

    def count_cycles(components: list) -> int:
        return sum(1 for component in components if is_cycle(component))

    n, edges = read_input()
    components = find_connected_components(n, edges)
    return str(count_cycles(components))

