    def find_mst_cost(edges):
        parent = [-1] * (n + 1)
        rank = [0] * (n + 1)
        cost = 0

        def find(x):
            if parent[x] < 0:
                return x
            parent[x] = find(parent[x])
            return parent[x]

        def union(x, y):
            root_x = find(x)
            root_y = find(y)

            if root_x == root_y:
                return False

            if rank[root_x] > rank[root_y]:
                parent[root_y] = root_x
            else:
                parent[root_x] = root_y
                if rank[root_x] == rank[root_y]:
                    rank[root_y] += 1
            return True

        for u, v, w in edges:
            if union(u, v):
                cost += w

        return cost

    lines = stdin.split("\n")
    n, m = map(int, lines[0].split())
    edges = []

    for i in range(1, m + 1):
        u, v, w = map(int, lines[i].split())
        edges.append((u, v, w))

    initial_cost = find_mst_cost(edges)
    min_operations = 0

    for u, v, w in edges:
        new_edges = edges.copy()
        new_edges.remove((u, v, w))
        new_edges.append((u, v, w + 1))
        new_cost = find_mst_cost(new_edges)

        if new_cost == initial_cost:
            min_operations += 1

    return str(min_operations)

