        adj_list[y-1].append((x-1, w))

    dist = [[float('inf')]*n for _ in range(n)]
    for i in range(n):
        dist[i][i] = 0

    def dijkstra(src):
        visited = [False]*n
        q = [(0, src)]
        while q:
            (d, node) = heappop(q)
            if not visited[node]:
                visited[node] = True
                for neighbor, weight in adj_list[node]:
                    new_dist = d + weight
                    if new_dist < dist[src][neighbor]:
                        dist[src][neighbor] = new_dist
                        heappush(q, (new_dist, neighbor))

    for i in range(n):
        dijkstra(i)

    shortest_paths = []
    for i in range(n):
        for j in range(i+1, n):
            shortest_paths.append(dist[i][j])

    shortest_paths.sort()
    kth_shortest = shortest_paths[k-1]

    return str(kth_shortest)

