        dist = [float('inf')] * n
        prev = [-1] * n
        dist[0] = 0
        queue = [0]

        while queue:
            u = queue.pop(0)
            for v in range(n):
                if v != u:
                    alt = dist[u] + manhattan_distance(x[u], y[u], x[v], y[v])
