    S = None
    for i in range(N):
        for j in range(M):
            if grid[i][j] == 'S':
                S = (i, j)
                break
        if S is not None:
            break
    if S is None:
        return "NOT POSSIBLE"

    def find_path(S: tuple, t: int) -> int:
        visited = set()
        queue = [(S, 0)]
        while queue:
            (i, j), time = queue.pop(0)
            if (i, j) not in visited:
                visited.add((i, j))
                if time >= t:
                    return -1
                if i == 0 or j == 0 or i == N - 1 or j == M - 1:
                    return time
                for dx, dy in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                    x, y = i + dx, j + dy
                    if 0 <= x < N and 0 <= y < M and grid[x][y] in ['0', 'U', 'D', 'L', 'R']:
                        if grid[x][y] == 'U' and dy != 1:
                            continue
                        if grid[x][y] == 'D' and dy != -1:
                            continue
                        if grid[x][y] == 'L' and dx != 1:
                            continue
                        if grid[x][y] == 'R' and dx != -1:
                            continue
                        queue.append(((x, y), time + 1))
        return -1

    result = find_path(S, t)
    if result == -1:
        return "NOT POSSIBLE"
    else:
        return str(result)

