def solution(stdin: str) -> str:
    def read_input(stdin: str) -> tuple:
        lines = stdin.splitlines()
        N, M = map(int, lines[0].split())
        P = [list(map(int, line.split())) for line in lines[1:]]
        return N, M, P

    def process_swathers(N: int, M: int, P: list) -> list:
        T = [0] * N
        for j in range(M):
            P_j = sorted([(P[i][j], i) for i in range(N)])
            for time, i in P_j:
                T[i] += time
                for k in range(j):
                    T[i] += P[i][k]
        return T

    N, M, P = read_input(stdin)
    T = process_swathers(N, M, P)
    return " ".join(map(str, T))

