        similarities.append((a, b))

    def horror_index(movie_id: int) -> int:
        if movie_id in horror_movies:
            return 0

        worst_similar_horror_index = float('inf')
        for a, b in similarities:
            if a == movie_id:
                worst_similar_horror_index = min(worst_similar_horror_index, horror_index(b))

        if worst_similar_horror_index == float('inf'):
            return float('inf')
        else:
            return worst_similar_horror_index + 1

    highest_horror_index = float('-inf')
    lowest_id = float('inf')
    for movie_id in range(num_movies):
        current_horror_index = horror_index(movie_id)
        if current_horror_index > highest_horror_index or (current_horror_index == highest_horror_index and movie_id < lowest_id):
            highest_horror_index = current_horror_index
            lowest_id = movie_id

    return str(lowest_id)

