    N = len(rows)
    M = len(rows[0])

    def spread(i, j):
        if 0 <= i < N and 0 <= j < M:
            if rows[i][j] == "V":
                if i > 0 and rows[i - 1][j] == ".":
                    rows[i - 1][j] = "V"
                if j > 0 and rows[i][j - 1] == ".":
                    rows[i][j - 1] = "V"
                    spread(i, j - 2)
                if j < M - 1 and rows[i][j + 1] == ".":
                    rows[i][j + 1] = "V"
                    spread(i, j + 2)

    for i in range(N):
        for j in range(M):
            if rows[i][j] == "V":
                spread(i - 1, j)

    return "\n".join(["".join(row) for row in rows])

